import { useState } from "react";
import HomePage from "./HomePage";
import AccountsPage from "./AccountsPage";
import TransactionsPage from "./TransactionsPage";
import BudgetPage from "./BudgetPage";
import ContactInfoPage from "./ContactInfoPage";
import ProfilePage from "./ProfilePage";

function NavigationBar(props) {

    const [pageInfo, setPageInfo] = useState('home');

    function page() {
        if (pageInfo == 'home') {
            return <HomePage username={props.username} />
        } else if (pageInfo == 'accounts') {
            return <AccountsPage username={props.username} />
        } else if (pageInfo == 'transactions') {
            // document.getElementById('homeBtn').classList.remove("disabled");
            // document.getElementById('accountBtn').classList.remove("disabled");
            // document.getElementById('transactionBtn').classList.add("disabled");
            // document.getElementById('budgetBtn').classList.remove("disabled");
            // document.getElementById('contactinfoBtn').classList.remove("disabled");
            // document.getElementById('profileBtn').classList.remove("disabled");
            return <TransactionsPage username={props.username} />

        } else if (pageInfo == 'budget') {

            return <BudgetPage username={props.username} />
        } else if (pageInfo == 'profile') {

            return <ProfilePage username={props.username} />
        } else {

        }
    }

    function chageTheme() {
        if (props.styles.bgColor == 'white' && props.styles.txColor == 'black') {
            props.setStyles({ bgColor: 'rgb(60, 60, 60)', txColor: 'rgb(125, 125, 125)' });
        } else {
            props.setStyles({ bgColor: 'white', txColor: 'black' });
        }
    }

    return (<>
        <div className="container-fluid px-0" style={{ backgroundColor: props.styles.bgColor, color: props.styles.txColor }}>
            <nav className="navbar navbar-expand-lg bg-dark sticky-top">
                <div className="container-fluid">
                    <button id="homeBtn" className="border-0 bg-dark navbar-brand" onClick={() => setPageInfo('home')}>
                        <img src="FinSyncIcon.png" id="navBrandLogo" style={{ height: '40px' }} alt="Logo" />
                        <label htmlFor="navBrandLogo" className="text-white" style={{ cursor: "pointer" }}>
                            &nbsp;FinSync
                        </label>
                    </button>
                    {/* <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
                        <i className="bi bi-segmented-nav text-white"></i>
                    </button> */}
                    {/* <div className="collapse navbar-collapse" id="navbarNav"> */}
                    <ul className="navbar-nav ms-auto">
                        <li className="nav-item m-1">
                            <button id="contactinfoBtn" className="border-0 bg-dark nav-link" onClick={() => chageTheme()}>
                                {(props.styles.bgColor == 'white' && props.styles.txColor == 'black') ?
                                    <i class="bi bi-moon-stars text-white"></i> : <i class="bi bi-sun text-white"></i>
                                }
                            </button>
                        </li>
                        <li className="nav-item m-1">
                            <button id="profileBtn" className="btn border-1 border-secondary rounded-circle bg-secondary" onClick={() => setPageInfo('profile')}>
                                {/* <img src="FinSyncIcon.png" style={{ height: '25px', width: '25px' }} alt="" /> */}
                                <i class="bi bi-person-fill text-white"></i>
                            </button>
                        </li>
                        <li className="nav-item m-1">
                            <button className="btn btn-danger" onClick={() => props.logOutUser()}>
                                Log Out
                            </button>
                        </li>
                    </ul>
                    {/* </div> */}
                </div>
            </nav>

            <div className="row">
                <div className="col-2 text-center fs-5" style={{ backgroundColor: 'rgb(247, 247, 254)', borderRight: '2px solid rgb(222, 222, 222)' }}>
                    <nav className="navbar navbar-expand-lg sticky-top">
                        <div className="container-fluid">
                            <ul className="navbar-nav flex-column">
                                <li className="nav-item m-1">
                                    <button id="hometBtn" className="text-dark border-0 bg-light nav-link" onClick={() => setPageInfo('home')}>
                                        <i class="bi bi-house-door"></i>&nbsp;Home
                                    </button>
                                </li>
                                <li className="nav-item m-1">
                                    <button id="itemsBtn" className="text-dark border-0 bg-light nav-link" onClick={() => setPageInfo('items')}>
                                        <i class="bi bi-bag-dash"></i>&nbsp;Items
                                    </button>
                                </li>
                                <li className="nav-item m-1">
                                    <button id="accountBtn" className="text-dark border-0 bg-light nav-link" onClick={() => setPageInfo('accounts')}>
                                        <i class="bi bi-bank"></i>&nbsp;Banking
                                    </button>
                                </li>
                                <li className="nav-item m-1">
                                    <button id="transactionBtn" className="text-dark border-0 bg-light nav-link" onClick={() => setPageInfo('transactions')}>
                                        <i class="bi bi-send"></i>&nbsp;Transactions
                                    </button>
                                </li>
                                <li className="nav-item m-1">
                                    <button id="budgetBtn" className="text-dark border-0 bg-light nav-link" onClick={() => setPageInfo('budget')}>
                                        <i class="bi bi-wallet2"></i>&nbsp;Budget
                                    </button>
                                </li>
                            </ul>
                            {/* </div> */}
                        </div>
                    </nav>
                </div>
                <div className="col-10 p-0">
                    <div className="px-5 pt-3">
                        {page()}
                    </div>
                    <div className="">
                        <ContactInfoPage username={props.username} />
                    </div>
                </div>
            </div>

        </div>
    </>);
}

export default NavigationBar;
